-- Table structure for corporation
-- ----------------------------
DROP TABLE IF EXISTS `corporation`;
CREATE TABLE `corporation`  (
  `corporationid` int(255) NOT NULL AUTO_INCREMENT COMMENT '公司id',
  `corporationname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公司名称',
  `isvisit` tinyint(2) NULL DEFAULT 0 COMMENT '是否拜访',
  `corporationlocation` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公司区域',
  `corporationaddress` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '公司地址',
  `corporationbidding` tinyint(2) NULL DEFAULT NULL COMMENT '是否招投标',
  `corporationactualpayment` double(255, 5) NULL DEFAULT NULL COMMENT '实缴数',
  `corporationregister` double(255, 5) NULL DEFAULT NULL COMMENT '注册数',
  `corporationsocialsecuritynumber` int(255) NULL DEFAULT NULL COMMENT '社保人数',
  `corporationgxdqdate` date NULL DEFAULT NULL COMMENT '高新到期时间',
  `corporationcertification` tinyint(2) NULL DEFAULT NULL COMMENT '高企认证次数',
  `corporationrqdqdate` date NULL DEFAULT NULL COMMENT '软企到期时间（空默认为无）',
  `corporationISO9001` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'ISO9001（varchar类型，可设多个）',
  `corporationISO20000` date NULL DEFAULT NULL COMMENT 'ISO20000date类型',
  `corporationISO27000` date NULL DEFAULT NULL COMMENT 'ISO27000date类型',
  `corporationfivestar` date NULL DEFAULT NULL COMMENT '五星售后（date类型，空为默认为无）',
  `corporationcombination` date NULL DEFAULT NULL COMMENT '两化融合（空默认为无）',
  `corporationjitc` date NULL DEFAULT NULL COMMENT '贯标（date类型，空默认为无）',
  `corporationsupplement1` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '其它补充1',
  `corporationsupplement2` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '其他补充2',
  `corporationwebsite` int(255) NULL DEFAULT NULL COMMENT '网站数量',
  `corporationapplet` int(255) NULL DEFAULT NULL COMMENT '小程序数量',
  `corporation3C` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '3C多日期',
  `corporationelse` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '其他信息',
  PRIMARY KEY (`corporationid`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 39 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

